import React, { Component } from 'react';
var chart = c3.generate({
  bindto: '#chart',
  data: {
    columns: [
      ['data1', 30, 200, 100, 400, 150, 250],
      ['data2', 50, 20, 10, 40, 15, 25]
    ]
  }
});
 class LineGraph extends Component {
    render() {
        
        return (
          <div id="chart"></div>
        );
    }
}export default LineGraph;
